"""
841. String Replace
Given two identical-sized string array A, B and a string S. All substrings A appearing in S are replaced by B.(Notice:
From left to right, it must be replaced if it can be replaced. If there are multiple alternatives, replace longer
priorities. After the replacement of the characters can't be replaced again.)

Example
Example 1

Input:
A = ["ab","aba"]
B = ["cc","ccc"]
S = "ababa"

Output: "cccba"
Explanation: In accordance with the rules, the substring that can be replaced is "ab" or "aba". Since "aba" is longer,
we replace "aba" with "ccc".
Example 2

Input:
A = ["ab","aba"]
B = ["cc","ccc"]
S = "aaaaa"

Output: "aaaaa"
Explanation: S does not contain strings in A, so no replacement is done.
Example 3

Input:
A = ["cd","dab","ab"]
B = ["cc","aaa","dd"]
S = "cdab"

Output: "ccdd"
Explanation: From left to right, you can find the "cd" can be replaced at first, so after the replacement becomes
"ccab", then you can find "ab" can be replaced, so the string after the replacement is "ccdd".

Notice
The size of each string array does not exceed 100, the total string length does not exceed 50000.
The lengths of A [i] and B [i] are equal.
The length of S does not exceed 50000.
All characters are lowercase letters.
We guarantee that the A array does not have the same string
"""
from typing import List


class Solution:
    """
    @param a: The A array
    @param b: The B array
    @param s: The S string
    @return: The answer
    """

    def stringReplace(self, a: List[str], b: List[str], s: str) -> str:
        if not (a and b and str):
            return s

        seed = 33
        mod = 1000007
        a_hash_values = []
        s_hash_values = []
        base_hash = []
        temp1 = 0
        temp2 = 0
        min_len = len(s)
        max_len = 0
        for i in s:
            temp1 = temp1 * seed % mod if temp1 != 0 else 1
            temp2 = (temp2 * seed + ord(i) - 96) % mod
            base_hash.append(temp1)
            s_hash_values.append(temp2)
        for i in a:
            min_len = min(min_len, len(i))
            max_len = max(max_len, len(i))
            temp1 = 0
            for j in i:
                temp1 = (temp1 * seed + ord(j) - 96) % mod
            a_hash_values.append(temp1)
        s_len = len(s)
        i = 0
        while i in range(s_len):
            temp1 = -1  # stores maxLen
            temp2 = -1  # stores index of str with maxlen
            for k, v in enumerate(a):
                cur_len = len(v)
                j = i + cur_len - 1
                if j >= s_len:
                    continue
                a_hash = a_hash_values[k]
                if i == 0:
                    s_hash = s_hash_values[j]
                else:
                    s_hash = (s_hash_values[j] - s_hash_values[i - 1] * base_hash[j - i + 1] % mod) % mod
                if a_hash == s_hash and v == s[i: j + 1] and cur_len > temp1:
                    temp1 = cur_len
                    temp2 = k
            if temp1 > -1:
                if i + temp1 == s_len:
                    s = s[:i] + b[temp2]
                    return s
                else:
                    s = s[:i] + b[temp2] + s[i + temp1:]
                    i = i + temp1
            else:
                i += 1
        return s


